import { Link } from 'react-router-dom';
import React from 'react';

function HeaderSec() {

    return (
        <div id="HeaderSec">
            <header >
                <div id="titleSec">
                    <h1>Jobs4U</h1>
                </div>

                <div id="searchBoxSec">
                    <input id="searchInput" type="text" placholder="Search" />
                    <button >Search</button>
                </div>

                <div id="links">
                    <Link >Home</Link>
                    <Link >Login</Link>
                    <Link >Register</Link>
                </div>
            </header >
        </div >
    );
}

export default HeaderSec;
